import React from "react";

const Footer = () => {

    return (
        <>
            <section className="footer">
                <div className="container">
                    <div className="row">
                        <div className="col-md-3">
                        <img src={require('./logo-new.png')} alt="logo" />
                        </div>
                    </div>
                </div>
            </section>
        </>

    );

}

export default Footer;
